import React from "react";
import { useParams } from "react-router-dom";
import { useCart } from "../context/CartContext";

const mockProducts = [
  {
    id: 1,
    name: "Dirt racing shoes",
    price: 90,
    category: "Shoes",
    description:
      "Brand-name shoes that keep clean in the sloppiest of dirt. Used to raise Potential Level.",
    image: "/dirtShoe.png",
  },
  {
    id: 2,
    name: "Mile racing shoes",
    price: 90,
    category: "Shoes",
    description:
      "A besteller that revolutionized the mile shoe industry. Used to raise Potential Level.",
    image: "/mileShoe.png",
  },
  {
    id: 3,
    name: "Medium racing shoes",
    price: 90,
    category: "Shoes",
    description:
      "The medium-distance shoes you can always trust. Used to raise Potential Level.",
    image: "/mediumShoe.png",
  },
  {
    id: 4,
    name: "Long racing shoes",
    price: 100,
    category: "Shoes",
    description:
      "Shoes from the Light Weight series that'll keep you light on your feet over long distances.",
    image: "/longShoe.png",
  },
  {
    id: 5,
    name: "Sprint racing shoes",
    price: 100,
    category: "Shoes",
    description:
      "The hottest new shore from a popular sprinting brand. Used to raise Potential Level.",
    image: "/sprintShoe.png",
  },
  {
    id: 6,
    name: "Carrot jelly mini",
    price: 19,
    category: "Food",
    description: "A jolt of energy that lasts for hours! Restores 1 RP.",
    image: "/carrotJelly.png",
  },
  {
    id: 7,
    name: "Juice",
    price: 49,
    category: "Food",
    description: "Drink this for revitalization! Restores 30 TP.",
    image: "/tp.png",
  },
  {
    id: 8,
    name: "Pleasing parfait",
    price: 29,
    category: "Food",
    description:
      "Raises a runner's mood to Great. Can be used in modes such as Team Trials.",
    image: "/parfait.png",
  },
  {
    id: 9,
    name: "Trainee scout ticket",
    price: 99,
    category: "Ticket",
    description: "Used for scouting Trainees. Can be used from the scout list.",
    image: "/traineeTicket.png",
  },
  {
    id: 10,
    name: "Support card scout ticket",
    price: 129,
    category: "Ticket",
    description:
      "Used for scouting Support Cards. Can be used from the scout list.",
    image: "/supportTicket.png",
  },
  {
    id: 11,
    name: "Silver cleat",
    price: 249,
    category: "Cleat",
    description:
      "A silver amulet in the shape of a cleat. Can be exchanged at the shop for various items.",
    image: "/silverCleat.png",
  },
  {
    id: 12,
    name: "Gold cleat",
    price: 279,
    category: "Cleat",
    description:
      "A gold amulet in the shape of a cleat. Can be exchanged at the shop for various items.",
    image: "/goldCleat.png",
  },
  {
    id: 13,
    name: "Rainbow cleat",
    price: 299,
    category: "Cleat",
    description:
      "A rainbow amulet in the shape of a cleat. Can be exchanged at the shop for various items.",
    image: "/rainbowCleat.png",
  },
  {
    id: 14,
    name: "Carats",
    price: 999,
    category: "Carats",
    description:
      "A rainbow-colored jewel in the shape of a carrot. It holds mystical power.",
    image: "/carats.png",
  },
];

const containerStyle = {
  padding: "2rem",
  maxWidth: "600px",
  margin: "0 auto",
};

const imageStyle = {
  width: "100%",
  borderRadius: "8px",
};

const titleStyle = {
  marginTop: "1rem",
};

const categoryStyle = {
  color: "#888",
};

const priceStyle = {
  fontWeight: "bold",
};

const buttonStyle = {
  padding: "0.75rem 1.5rem",
  background: "#6ABA00",
  color: "white",
  border: "none",
  borderRadius: "4px",
  cursor: "pointer",
};

const notFoundStyle = {
  padding: "2rem",
  textAlign: "center",
};

function ProductDetailsPage() {
  const { id } = useParams();
  const { addToCart } = useCart();
  const product = mockProducts.find((p) => p.id === parseInt(id));

  if (!product) {
    return <p style={notFoundStyle}>Product not found.</p>;
  }

  return (
    <div style={containerStyle}>
        <div style={leftSection}>
            
        </div>

        <div style={rightSection}></div>

        <img src={product.image} alt={product.name} style={imageStyle} />
        <h2 style={titleStyle}>{product.name}</h2>
        <p style={categoryStyle}>{product.category}</p>
        <p style={priceStyle}>${product.price}</p>
        <p>{product.description}</p>
        <button style={buttonStyle} onClick={() => addToCart(product)}>
            Add to Cart
        </button>

    </div>
  );
}

export default ProductDetailsPage;
